import React from 'react';
import './index.css';

const Result = ({previewCorrect,previewIncorrect,previewNextQuestion,buttonDisabler,handleNextQuestion}) => {


    return (
        <div className="but_Container"> 
        <div className="tobeCentered">
        {previewIncorrect && <p><b>Sorry!</b></p>}
        {previewCorrect && <p><b>Correct!</b></p>}
        {(previewNextQuestion && !buttonDisabler) && <button className="but_" type="button" onClick={ () =>handleNextQuestion()}>NextQuestion</button>}
        </div>
        </div>
    );
}

export default Result;
